import React from 'react';
import './Chat.css';


function Chat() {
  return (
    <div>
      <link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css"/>
      <div className='conv-container'>
      </div>
      <div className='conv-analysis'>
        <table>
          <tr>
            <td>100</td>
            <td>200</td>
            <td>300</td>
          </tr>
          <tr>
            <td>400</td>
            <td>500</td>
            <td>600</td>
          </tr>
        </table>
      </div>
    </div>
  );
}

export default Chat;
